message:
Новые санкции от Великобритании. Помимо санкций против ВТБ, королевство ограничит:

- полёты «Аэрофлота» в Лондон и Манчестер;
- экспорт высокотехнологичной продукции из России;
- размер вкладов россиян в британских банках.

Борис Джонсон не исключил, что в скором времени Россию отключат от SWIFT, но для этого нужна единая позиция. А пока страну будут «выдавливать из мировой экономики».
